INSERT INTO `event` VALUES (1, 'ASIAN CREDIT UNION FORUM 2008 CREDIT UNIONS SERVING THE UNDERSERVED', '2008-09-01', '2008-09-24', 1, '<p><span style="font-family: arial,helvetica,sans-serif"><strong>Asian Credit Union Forum 2008 </strong><strong>Credit Unions Serving the Underserved</strong><strong>&nbsp;&nbsp; </strong></span></p>\r\n<p><strong><span style="font-size: xx-small; font-family: arial,helvetica,sans-serif">September 26-27, 2008, Dhaka, Bangladesh</span></strong></p>\r\n<p><span style="font-size: x-small"><span style="font-size: xx-small"><span style="font-family: arial,helvetica,sans-serif"><strong>Organizer&nbsp;</strong></span><span style="font-family: arial,helvetica,sans-serif"><strong>&nbsp;&nbsp; Asian Confederation of Credit Unions</strong></span></span></span></p>\r\n<p><span style="font-size: x-small"><span style="font-size: xx-small"><strong><span style="font-family: arial,helvetica,sans-serif">&nbsp;</span></strong><span style="font-family: arial,helvetica,sans-serif"><strong><em>Host: </em></strong></span><strong>Cooperative Credit Union league of bangladesh</strong></span></span></p>\r\n<p><span style="font-size: x-small"><span style="font-size: xx-small"><strong>&nbsp;</strong>Dear Credit Union Friends,</span></span></p>\r\n<p>Please join us for the 2008 Asian Credit Union Forum, hosted by the Cooperative Credit Union League of Bangladesh, Ltd. We are very excited to welcome you in Bangladesh, a lush land with a rich history and passionate people.</p>\r\n<p>This annual event brings together leading credit union experts and participants from a broad range of fields, to give a fresh look at growth strategies enabling credit unions to present better choices, better organizations and better society to members and their families.</p>\r\n<p>The slate of renowned speakers provides you with:</p>\r\n<ul>\r\n    <li>&sect; A fresh perspective on global socioeconomic trends for you to appreciate the need for credit unions to grow in number and quality</li>\r\n    <li>&sect; A contemporary framework to guide your growth plans for 2009 and beyond</li>\r\n    <li>&sect; A well-developed line-up of marketers and expertise whose unique strategies can potentially add innovation and vitality to credit union financial services</li>\r\n</ul>\r\n<p>In this forum, ACCU''s proposition to credit union leaders across Asia is to place credit unions'' steady growth as movement''s goal in the next decade. With the topics outlined, the forum will certainly let you realize the underserved market we need to enter on as a source of credit union growth. Finding our &lsquo;blue ocean'' or new market space is something that we in Asian credit unions require to become skillful.</p>\r\n<p>&nbsp;The fight against poverty is the credit union original mission. The Forum is a great opportunity for us to reexamine how far we have lived our mission for which our founding father F.W. Raiffeisen founded in 1846. Raiffeisen founded the first credit union, providing banking services to&nbsp;members, helping people consolidate their savings, and granting loans to&nbsp;members on&nbsp;reasonable terms. This forum presents a successful poverty alleviation program in Bangladesh. Let us join the dynamic Founder and President of the Association for Social Advancement (ASA), Md. Shafiqual Haque Choudhury for the total immersion in various aspects of ASA''s success on poverty alleviation programs.</p>\r\n<p>&nbsp;Additionally, the youth market is critical because of the demographics'' <a title="Buying power" href="http://en.wikipedia.org/wiki/Buying_power">buying power</a> and their influence on the spending of family members. In most developing countries, women integration in credit unions has to be seriously discussed and given due attention. We hope that this forum will generate fresh commitment to be of better service to the underserved market, making our existence meaningful and relevant for our members and their communities. &nbsp;</p>\r\n<p>&nbsp;The Forum will provide you with the opportunity to meet highly regarded names in the credit union industry across the spectrum of expertise in pursuing unique niche strategies as well as specialized strategies.</p>', 'p', 'Dhaka, Bangladesh ', 'kasun.jpg');
INSERT INTO `event` VALUES (2, 'WOMEN EMPOVERMENT THROUGH CREDIT UNION MICROFINANCE INNOVATIONS ', '2008-09-22', '2008-09-24', 1, '<p><strong>&nbsp;Intensifying&nbsp;&nbsp; Women empoverment Through Credit Union Microfinance Innovations </strong></p>\r\n<p align="center"><strong><em>Theme: Building Vibrant Solutions to Reach and Empower &quot;Have Less&quot; </em></strong><strong><em>&nbsp;Through Credit Unions </em></strong></p>\r\n<p align="center">September 22 to 24, 2008&nbsp;&nbsp;</p>\r\n<p>Introduction&nbsp;</p>\r\n<p>&nbsp;Asia and the Pacific, is home for 900 million poor people, nearly one third of the region''s population, this is a startling fact. It is nearly one third of the region''s population. ACCU is intensifying its commitment to support members and credit unions to reinvigorate their role in reaching the &lsquo;have less'' in response to the Millennium Development Goals'' target of reducing poverty by 50% in 2015.</p>\r\n<p>&nbsp;The Credit Union Microfinance Innovation (CUMI) is a sustainable provision of financial services and education to the &lsquo;have less.'' To ACCU, the ultimate goal for poverty alleviation is empowerment of the &lsquo;have less'' wherein poor people demonstrate the ability to make choices regarding his or her life. Since credit unions are financial institutions, interventions are made on the financial lives of members, which then present social and political empowerment.</p>\r\n<p>&nbsp;ACCU upholds the role of credit unions as trusted wealth creation advisor for members at conferences, training and credit union solutions developed. ACCU believes that any savings or loans provided by credit unions to members especially to the &lsquo;have less'' will ultimately build their wealth rather than debt. Credit unions'' main objective is helping members reach their financial destination - the big leap out of the vicious cycle of poverty.</p>\r\n<p><em>&nbsp;</em><em>ACCU Takes Part in Global Networking on Microfinance:</em><strong> </strong></p>\r\n<p>Along with eight heads of large Microfinance Institutions, ACCU signed the &lsquo;Microcredit Summit Commitment Statement'' pledging to work with the Campaign to find and implement credible methodologies for measuring progress regarding the US$1 a day threshold. The CUMI software on tracking human development indicators of CUMI members is developed as a solution to measure up the impact on the lives of members. &nbsp;</p>\r\n<p><em>&nbsp;</em><em>Institutionalizing CUMI service to reach the Poor:</em><strong> </strong></p>\r\n<p>ACCU communicated with credit unions and Federations to have greater partnership with &lsquo;have less''. The microfinance services of the credit unions using the CUMI methodology have helped &lsquo;have less'' members in the Philippines, Cambodia, Indonesia, Vietnam, Sri Lanka and&nbsp; Nepal.&nbsp;</p>\r\n<p>&nbsp;Despite the efforts in the last 12 years as described above, the vast majority of the Asia''s poor continue to lack access to basic financial services that are an essential tool for them to better lives. Additionally, a huge number of &lsquo;have less'' in each country needs the services of credit unions, though ACCU record shows an outreach of 5.3 million in 2006.</p>\r\n<p>The workshop intends to review the effectiveness of CUMI as solution in reaching the &lsquo;have less.&quot; ACCU considers that increasing quality outreach requires developing human capital (leaders and professionals) to build the capacity credit unions. There is a greater need to educate the credit union leaders that the provision of affordable financial services to the &lsquo;have less'' is the original mission of credit union as started by F.W. Raiffeisen more than 150 years ago in Germany. The credit unions should also be aware that in recent years, the microfinance sector has matured and deepened. ACCU has recognized that the need to address the financial needs of very small enterprises wishing to transform themselves into full-fledge SMEs. On the other hand, micro entrepreneurs are desperately looking for avenues to improve and market their products to ensure gainful employment.</p>\r\n<p>&nbsp;Purpose</p>\r\n<p>&nbsp;The four days workshop brings together the technical staff, specialists and practitioners in the CUMI field from ACCU member organizations and partners. The workshop will discuss the future of CUMI as a tool for fighting poverty, its sustainability, and the role that ACCU and national federations can play.</p>\r\n<p>The goals of this workshop are:</p>\r\n<p>&nbsp;1. Demonstrate the growth of the microfinance industry; its realities, challenges and opportunities to credit unions</p>\r\n<ul>\r\n    <li>2. Be guided by the important mission of credit unions in poverty alleviation</li>\r\n    <li>3. Learn the best practices and challenges of developing country credit unions in reaching the &lsquo;have less''</li>\r\n    <li>4. Gain skills in using CUMI software to measure the impact of CUMI to its members</li>\r\n    <li>5. Introduce solutions to the challenges encountered by credit unions on CUMI to ensure sustainability and growth of the program and its members</li>\r\n    <li>6. Provide directions for developing an in-depth implementation of poverty alleviation programs in credit unions</li>\r\n</ul>\r\n<p>&nbsp;Topics:</p>\r\n<p>&nbsp;1. The Microfinance Industry: Realities, Challenges and Opportunities to Credit Unions</p>\r\n<p>2. CUMI: Achieving Sustainability and the &quot;Triple Bottom Line&quot;</p>\r\n<p>3. Country Presentation: Measuring Up Credit Union Performance: How far have we reached?</p>\r\n<p>4. Review of the Credit Union Microfinance Innovation Methodology</p>\r\n<p>5. Case Presentation: Build Operate Transfer Approach to Microfinance</p>\r\n<p>6. Has CUMI Alleviated &lsquo;have less'' from Poverty?: CUMI Software</p>\r\n<p>7. Building Vibrant Solutions to Reach and Empower &quot;Have Less&quot; Through Credit Unions</p>\r\n<p>8. Presentation: Future Direction of Credit Union Microfinance Innovations</p>\r\n<p>Training Methodology:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>The training applies participatory method, which among others include experiential exercises, case studies, and special group work, sharing experiences and field visit to successful entrepreneurs and microfinance programs for the poor.</p>\r\n<p><strong>Results</strong></p>\r\n<p>Improved institutional performance of 15 member credit union movements in Asia</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Participants:</strong></p>\r\n<p>&nbsp;The staff of the national federation in-charge of&nbsp; Women and development/ Women national leader / Credit Union Microfinance Innovation Program and Business Development Center will attend the workshop. Each participant is requested to prepare a report on the achievements of its programs highlighting the following:</p>\r\n<p>&nbsp;&sect; CUMI Features</p>\r\n<p>&sect; No. of Credit Unions implementing</p>\r\n<p>&sect; Since when the program is implemented</p>\r\n<p>&sect; Challenges and future prospects</p>\r\n<p>Disaggregated Data on Men and Women</p>\r\n<p>&sect; Total &lsquo;have less'' members recruited as of June 2008</p>\r\n<p>&sect; The total amount of loan granted, repayment and delinquency rate</p>\r\n<p>&sect; Savings and Share Capital</p>\r\n<p><strong>Methodology:</strong></p>\r\n<p>&nbsp;The workshop serves as a platform for ACCU members to share and exchange ideas and experiences. Thus, a participatory method will be adopted facilitated by an experienced resource person.</p>\r\n<p><strong>&nbsp;</strong><strong>Date and Venue:</strong></p>\r\n<p>The workshop will be organized during September 22 to 24, 2008 at Dhaka Sheraton Hotel, Bangladesh.</p>\r\n<p align="center"><strong>Tentative Daily Schedule</strong></p>\r\n<p align="center">September 22 to 24, 2008</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<table cellspacing="0" cellpadding="0" border="1">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="top" width="631" colspan="3">\r\n            <p align="center"><strong>September&nbsp; 21, Sunday</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">14:00 onwards</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p>Arrival of Participants</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="631" colspan="3">\r\n            <p align="center"><strong>September&nbsp; 22, Monday</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">8:30 - 9:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p>Registration</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">9:00 - 10:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p>Opening Program</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:00 - 10:30</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p>Morning Break</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:30 - 12:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>The Microfinance Industry: Realities, Challenges and Opportunities to Credit Unions</strong></p>\r\n            <p>Microfinance practices have developed and diversified considerably since the Grameen Bank was established in 1983. The client base microfinance approach is predominantly occupying a large base of the market. In reality, it is undermining the pioneering work of credit unions as the first microfinance institution some 150 years ago. In this session, the resource person will facilitate the sharing on the different types of suppliers of microfinance services and its challenges and opportunities posed to credit unions.</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">12:00 - 13:30</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Lunch Break </strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">13:30 - 15:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>CUMI: Achieving Sustainability and the &quot;Triple Bottom Line&quot;</strong></p>\r\n            <p>ACCU develops the Credit Union Microfinance Innovations (CUMI) that alleviates poverty in three ways: in the short term, it enables beneficiaries to earn income from an economic activity. In the long term, it is a very important tool for developing entrepreneurship at the grass roots level and&nbsp;&nbsp; gain political power at the credit union level. Thus, CUMI enables the &lsquo;have less'' to be empowered economically, socially and politically. At this session, ACCU will share its vision on Credit Union poverty alleviation program through CUMI including its intervention with member organizations and linkages with other international institutions to promote the role of credit unions on poverty alleviation. At this session, ACCU will also share the commitment of the Asian credit unions in reaching the Millennium Development Goals.&nbsp;</p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">15:00 - 15:30</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Afternoon Break </strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<table cellspacing="0" cellpadding="0" border="1">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">15:30 - 17:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>Country Presentation: Measuring Up Credit Union Performance: How far have we reached? </strong></p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Participants from each organization shall present a brief highlight of the achievement of their &lsquo;have less'' outreach program for maximum 10 minutes. The following will be highlighted in brief:</p>\r\n            <p>&nbsp;</p>\r\n            <ul>\r\n                <li>&sect; Description of the program (CUMI or other name)</li>\r\n                <li>&sect; Outreach - number credit unions and &lsquo;have less'', savings mobilized, loan portfolio, delinquency ratio</li>\r\n                <li>&sect; Lessons and challenges</li>\r\n            </ul>\r\n            <p>&nbsp;</p>\r\n            <p>The facilitator will synthesize the presentations and thus will be an input to enhance the credit union solutions to reach the &lsquo;have less''</p>\r\n            <ul>\r\n                <li>&sect;</li>\r\n            </ul>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">18:00</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Reception Dinner </strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="631" colspan="3">\r\n            <p align="center"><strong>September&nbsp; 23,&nbsp; Tuesday</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">8:30 - 9:00</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p>Management Team Report</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">9:00 - 10:00</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Continuation: Country Presentations and Synthesis </strong></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:00 - 10:30</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p>Morning Break</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:30 - 12:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>Review of the Credit Union Microfinance Innovation Methodology </strong></p>\r\n            <p>The session will look back on the synthesis of country presentations particularly on the challenges faced by practitioners. The session will conclude on recommendations to improve the CUMI solution to ensure quality and sustainability of both program and &lsquo;have less'' members</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">12:00 - 13:30</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Lunch Break </strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">13:30 - 15:00</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>Case Presentation: Build Operate Transfer Approach to Microfinance</strong></p>\r\n            <p>The National Confederation of Cooperatives (NATCCO) in the Philippines will share the innovation on microfinance implemented in partnership with its credit union members.</p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">15:00 - 15:30</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>Afternoon Break </strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">15:30 - 17:30</p>\r\n            </td>\r\n            <td valign="top" width="396">\r\n            <p><strong>Has CUMI Alleviated &lsquo;have less'' from Poverty?: CUMI Software</strong></p>\r\n            <p>ACCU will demonstrate the CUMI software intended to measure the progress of &lsquo;have less'' members.&nbsp; The software measures the human development index of members before and after accessing the CUMI services of credit unions.</p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td valign="top" width="72">\r\n            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">14:30 - 17:00</p>\r\n            </td>\r\n            <td valign="top" width="468" colspan="2">\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<p align="center">&nbsp;</p>\r\n<p>\r\n<table cellspacing="0" cellpadding="0" border="1">\r\n    <tbody>\r\n        <tr>\r\n            <td valign="top" width="649" colspan="3">\r\n            <p align="center"><strong>September&nbsp; 24,&nbsp; Wednesday</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">8:30 - 9:00</p>\r\n            </td>\r\n            <td valign="top" width="408">\r\n            <p>Management Team Report</p>\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n            <td valign="top" width="78">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">9:00 - 10:00</p>\r\n            </td>\r\n            <td valign="top" width="408">\r\n            <p><strong>Building Vibrant Solutions to Reach and Empower &quot;Have Less&quot; Through Credit Unions </strong></p>\r\n            <p>The session will look at the barriers or constraints why credit unions are not creating a significant impact on reaching the &lsquo;have less''. The participants will focus on discovering the solutions to overcome the challenges. The session will end up with an innovative solutions to reach and empower the &lsquo;have less''</p>\r\n            </td>\r\n            <td valign="top" width="78">\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:00 - 10:30</p>\r\n            </td>\r\n            <td valign="top" width="408">\r\n            <p><strong>Lunch Break</strong></p>\r\n            </td>\r\n            <td valign="top" width="78">\r\n            <p><strong>&nbsp;</strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">10:30 - 12:00</p>\r\n            </td>\r\n            <td valign="top" width="408">\r\n            <h4>Recommendation and Action Plan</h4>\r\n            </td>\r\n            <td valign="top" width="78">\r\n            <h4>&nbsp;</h4>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <h4>12:00 - 13:30</h4>\r\n            </td>\r\n            <td valign="top" width="486" colspan="2">\r\n            <h4>Lunch Break&nbsp;</h4>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <h4>13:30 - 15:30</h4>\r\n            </td>\r\n            <td valign="top" width="486" colspan="2">\r\n            <h4>Reporting Recommendations to the CEOs Advisory Committee</h4>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">15:30 - 16:00</p>\r\n            </td>\r\n            <td valign="top" width="486" colspan="2">\r\n            <p><strong>Afternoon Break </strong></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign="top" width="163">\r\n            <p align="center">16:00 - 17:00</p>\r\n            </td>\r\n            <td valign="top" width="486" colspan="2">\r\n            <p><strong>Closing Program </strong></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>', 'p', 'Dhaka - Bangladesh', '');
INSERT INTO `event` VALUES (3, 'CEO’s Workshop - The Asian Credit Union Future', '2008-09-22', '2008-09-24', 1, '<p>The Credit Union Chief Executive Officers Workshop is a platform, which creates a nurturing environment for CEOs dedicated to improving the quality and competitiveness of their credit unions through shared experience and personal growth. The workshop offers CEOs an opportunity to acquire knowledge on global credit union management ideas, business resources, individual growth sharing, and more freedom for individual member development. ACCU recognizes the important role of CEOs and General Managers of its member organizations, as they occupy the singular organizational position primarily responsible for carrying out the strategic plans and policies established by the board of directors. Meanwhile, in ACCU, the CEOs play an important role in providing feedback and inputs enabling ACCU to position its services based on the current needs and issues faced by Asian credit unions.</p>', 'p', 'Dhaka - Bangladesh', '');
INSERT INTO `event` VALUES (4, '8th Regional Workshop on Credit Union Youth Marketing', '2008-09-21', '2008-09-25', 1, '<p><strong>Credit unions are getting old! </strong></p>\r\n<p>&nbsp;</p>\r\n<p>ACCU Road Map has given highest priority in assisting its members to reach the youth market. At present, membership profile of Credit Unions suggests that 80% of the present members belong to the age group of 45 to 65 years old. Youth involvement in credit unions is less than 10% - an issue that has to be addressed urgently for the sustainability of Asian credit union system. ACCU attempts to provide platforms and action research to innovate and introduce new ways of serving the youth market based on their expectations.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Impediments</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Traditional product offerings, absence of aggressive marketing programs and lack of resolve of leaders to direct resources to youth programs are some of the impediments seen in most credit unions. &nbsp;In fact, credit unions have yet to realize the need of careful study on youth market and consequently appoint a person taking charge of product packaging and developing aggressive marketing campaign. With these propositions, youth would be able to see the value of the product offerings of the credit unions.</p>', 'p', 'Dhaka - Bangladesh', '');
INSERT INTO `event` VALUES (5, 'Credit Unions Regulators Workshop “Prudent management and Operational Performance Standard of CU”', '2008-07-28', '2008-08-01', 14, '<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><strong><span><span>Goal</span></span></strong><span>Improved ability of Asian credit unions, particularly in &lsquo;economies in transition&rsquo; to serve a wider base of members through delivery of competitive financial services.</span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span>&nbsp;</span><strong><span><span>Project Purpose</span></span></strong><span>To improve the professional management capacity within Asian credit union systems and to explore possible organizational delivery models which enable and promote the development of a &ldquo;professionalized&rdquo; credit union system in Asia.</span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span><span>The workshop cum exposure is a platform to share the experience of credit unions regulations and monitoring in Indo China countries to come up with set of prudential standards for the monitoring of credit unions. <span>&nbsp;</span></span></span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;">&nbsp;</p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><strong><span><span>Objectives:</span></span></strong></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;">&nbsp;</p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span><span><span>-</span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>To discuss<span>&nbsp; </span>and prepare<span>&nbsp; </span>monitoring tool for<span>&nbsp; </span>credit unions at every level</span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span><span><span>-</span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>To<span>&nbsp; </span>review<span>&nbsp;&nbsp; </span>present<span>&nbsp;&nbsp; </span>legislative issues in operation of CUs </span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span><span><span>-</span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>To present<span>&nbsp; </span>showcase<span>&nbsp; </span>of PEARLS<span>&nbsp; </span>system on CUs<span>&nbsp; </span>monitoring </span></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;">&nbsp;</p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><strong><span><span>Organization:</span></span></strong></p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;">&nbsp;</p>\r\n<p class="\\&quot;\\\\&quot;MsoNormal\\\\&quot;\\&quot;"><span>The Workshop cum exposure program of Legislators /Administrators of credit unions <span>&nbsp;</span>will<span>&nbsp; </span>be conducted in collaboration with the Central Peoples Credit<span>&nbsp; </span>Fund and State Bank of <span>&nbsp;</span>Vietnam. </span></p>', 'p', 'Hanoi, Vietnam - Vietnam', '');
INSERT INTO `event` VALUES (6, 'The Asian Development Education Workshop', '2008-06-15', '0000-00-00', 13, 'The Development Education Workshop is an intensive personal motivation and awareness raising process that begins with the participation in a five days residential workshop conducted by the Association of Asian Confederation of Credit Unions in partnership with WAW Credit Union (Australia). The Asian Development Education Program started in 1999. ACCU, after attending the Australian DE Program has generated tremendous motivation and obligation to replicate the Australian DEP course in Asia. From 1999 to 2004, CUFA had supported this endeavor to multiply the impact to as many Asian credit unions as possible. WAW Credit Union through its Chairman Bill Field supports the Asian DEP believing that it is an excellent vehicle to promote the values associated with credit unions worldwide. From 1999, 262 DEs from Bangladesh, Fiji, Hong Kong, Malaysia, Nepal, Indonesia, Singapore, Philippines, Taiwan, Sri Lanka. Korea and Thailand graduated from Asian DEP and more that 50 DE graduates from Australia. They have performed extremely well in their presentations, developed self confidence, and widened understanding of global credit union system and issues\r\n', 'p', 'Thailand', NULL);
INSERT INTO `event` VALUES (7, 'Credit Union CEOs Competency Course', '2008-06-15', '0000-00-00', 13, 'The Association of Asian Confederation of Credit Unions invites you to: ACCU recognizes the important role of the Chief Executive Officers or General Managers of credit unions. The CEO is the singular organizational position that is primarily responsible to carry out the strategic plans and policies as established by the board of directors. The CEO is responsible for the success or failure of the credit union. Operations, marketing, strategy, financing, creation of organizational culture, human resources, hiring, firing, compliance with regulations, sales, PR, etc.—it all falls on the CEO’s shoulders. ', 'p', 'Thailand', NULL);
INSERT INTO `event` VALUES (8, '63 Board of Directors of Association of Asian Confederation of Credit Unions', '2008-03-28', '0000-00-00', 6, '<div align="justify">No 949 Dusan Dong Seo &ndash;Ku Daejeon, Metropolitan City 302 -120 Korea</div>', 'p', 'No 949 Dusan Dong Seo –Ku Daejeon, Metropolitan City 302 -120 Korea ', '');
INSERT INTO `event` VALUES (9, 'CEO Workshop on NACUFOK’s CU Business Process ', '2008-03-24', '0000-00-00', 6, '<div align="justify">No. 949 Dunsan-dong, Seo-ku, Daejeon Metropolitan city, 302-120 Republic of Korea</div>', 'p', 'South Korea', '');
INSERT INTO `event` VALUES (10, 'World Credit Union Conference 2008', '0000-00-00', '0000-00-00', 2, '<p>Join credit union leaders from around the world for the 2008 World Credit Union Conference! Held July 13 - 16 in Hong Kong, it is the only meeting of its kind, bringing together credit union leaders from more than 50 different countries. In addition to providing excellent networking opportunities, this four-day program focuses on current industry issues and innovative ideas you can take back and implement in your credit union</p>', 'p', 'Hong Kong', '');
