f";\r\n	mso-fareast-font-family:Batang;\r\n	mso-fareast-language:KO;\r\n	mso-bidi-language:TH;\r\n	font-weight:bold;}\r\n.MsoChpDefault\r\n	{mso-style-type:export-only;\r\n	mso-default-props:yes;\r\n	font-size:10.0pt;\r\n	mso-ansi-font-size:10.0pt;\r\n	mso-bidi-font-size:10.0pt;\r\n	mso-fareast-font-family:Batang;\r\n	mso-bidi-font-family:"Angsana New";}\r\n@page Section1\r\n	{size:8.5in 11.0in;\r\n	margin:1.0in 1.0in 1.0in 1.0in;\r\n	mso-header-margin:.5in;\r\n	mso-footer-margin:.5in;\r\n	mso-paper-source:0;}\r\ndiv.Section1\r\n	{page:Section1;}\r\n-->\r\n</style><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:"Table Normal";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-qformat:yes;\r\nmso-style-parent:"";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:"Calibri","sans-serif";\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:"Times New Roman";\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:"Times New Roman";\r\nmso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">Attendees are the Trainers or technical staff of the national federations of ACCU member organizations and technical person from the Cooperative or Auditing Department in charge of the supervision and inspection of cooperatives/credit unions.<span style="">&nbsp; </span></span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">ACCU has developed the quality assurance tool for credit unions called ACCESS, an acronym for A-1 Competitive Choice for Competitiveness and Excellence in Service and Soundness. Using the Balanced Scorecard architecture, ACCESS comprises 86 indicators on four perspectives of credit union operations &ndash; finance, learning and growth, customer-member and internal business processes. At this training, ACCU is building the capacity of its member organizations to carry out quality assurance review of credit unions undergoing ACCESS accreditation. </span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><o:p></o:p></span></p>\r\n</p>', 'up comming', '', '');
