-font-size:10.0pt;\r\n	mso-bidi-font-size:10.0pt;\r\n	mso-fareast-font-family:Batang;\r\n	mso-bidi-font-family:"Angsana New";}\r\n@page Section1\r\n	{size:8.5in 11.0in;\r\n	margin:1.0in 1.0in 1.0in 1.0in;\r\n	mso-header-margin:.5in;\r\n	mso-footer-margin:.5in;\r\n	mso-paper-source:0;}\r\ndiv.Section1\r\n	{page:Section1;}\r\n-->\r\n</style><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:"Table Normal";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-qformat:yes;\r\nmso-style-parent:"";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:"Calibri","sans-serif";\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:"Times New Roman";\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:"Times New Roman";\r\nmso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">The Development Education Workshop is an intensive personal motivation and awareness raising process that begins with the participation in a five days residential workshop conducted by the Association of Asian Confederation of Credit Unions</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; text-transform: uppercase;">.</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> The objective is to provide participants with the knowledge, skills and confidence to be effective Credit Union Advocates and this is achieved through their commitment and enthusiasm. ACCU is proud to have 295 Development Educators who are connected with ACCU member organizations, all with extra dedication and ability to spread the message of safe and sound credit unions throughout <st1:place w:st="on">Asia</st1:place>. Credit union volunteers, professionals and development workers are most welcome to participate.</span></p>', 'up comming', '', '');
