}\r\n.MsoChpDefault\r\n	{mso-style-type:export-only;\r\n	mso-default-props:yes;\r\n	font-size:10.0pt;\r\n	mso-ansi-font-size:10.0pt;\r\n	mso-bidi-font-size:10.0pt;\r\n	mso-fareast-font-family:Batang;\r\n	mso-bidi-font-family:"Angsana New";}\r\n@page Section1\r\n	{size:8.5in 11.0in;\r\n	margin:1.0in 1.0in 1.0in 1.0in;\r\n	mso-header-margin:.5in;\r\n	mso-footer-margin:.5in;\r\n	mso-paper-source:0;}\r\ndiv.Section1\r\n	{page:Section1;}\r\n-->\r\n</style><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:"Table Normal";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-qformat:yes;\r\nmso-style-parent:"";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:"Calibri","sans-serif";\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:"Times New Roman";\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:"Times New Roman";\r\nmso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">CEOs Workshop:</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"> </span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><span style="">&nbsp;</span></span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">Participants are Chief Executive Officers and key management staff of ACCU&rsquo;s member organizations. The workshop encourages CEOs to freely deliberate on the current pressing issues on credit union development.<span style="">&nbsp; </span>Together it allows CEOs to innovate with the advice of technical experts.</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><o:p></o:p></span></p>\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><o:p>&nbsp;</o:p></span></p>\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">HRD Workshop:</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><span style="">&nbsp; </span></span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">Participants are the Heads/Key Staffs of the Training/HR Department of the National Federations, Development Educators and members of the Asian Leaders and Managers Institute.<span style="">&nbsp; </span>The workshop would introduce solutions to professionalize credit unions.<span style="">&nbsp; </span></span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"><o:p></o:p></span></p>\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><o:p>&nbsp;</o:p></span></p>\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Youth Workshop:</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"> </span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">Participants are the members of the Youth Task Force Committee or staff -in-charge for the youth promotion of the national federation.<span style="">&nbsp; </span>The workshop will introduce product innovation to attract youth to use the services of credit unions.<o:p></o:p></span></p>\r\n<p style="" class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><o:p>&nbsp;</o:p></span></p>\r\n<p class="MsoNormal"><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Women Workshop:</span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;"> </span><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-weight: normal;">Participants are the members of the Women Task Force Committee or staff -in-charge in the promotion of Women Empowerment Program in the National Federations.<span style="">&nbsp; </span>The workshop will share experience on the promotion of Microfinance as tool for women empowerment.<o:p></o:p></span></p>\r\n</p>', 'up comming', '', '');
