so-fareast-font-family:Batang;\r\n	mso-fareast-language:KO;\r\n	mso-bidi-language:TH;\r\n	font-weight:bold;}\r\n.MsoChpDefault\r\n	{mso-style-type:export-only;\r\n	mso-default-props:yes;\r\n	font-size:10.0pt;\r\n	mso-ansi-font-size:10.0pt;\r\n	mso-bidi-font-size:10.0pt;\r\n	mso-fareast-font-family:Batang;\r\n	mso-bidi-font-family:"Angsana New";}\r\n@page Section1\r\n	{size:8.5in 11.0in;\r\n	margin:1.0in 1.0in 1.0in 1.0in;\r\n	mso-header-margin:.5in;\r\n	mso-footer-margin:.5in;\r\n	mso-paper-source:0;}\r\ndiv.Section1\r\n	{page:Section1;}\r\n-->\r\n</style><!--[if gte mso 10]>\r\n<style>\r\n/* Style Definitions */\r\ntable.MsoNormalTable\r\n{mso-style-name:"Table Normal";\r\nmso-tstyle-rowband-size:0;\r\nmso-tstyle-colband-size:0;\r\nmso-style-noshow:yes;\r\nmso-style-priority:99;\r\nmso-style-qformat:yes;\r\nmso-style-parent:"";\r\nmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\nmso-para-margin:0in;\r\nmso-para-margin-bottom:.0001pt;\r\nmso-pagination:widow-orphan;\r\nfont-size:11.0pt;\r\nfont-family:"Calibri","sans-serif";\r\nmso-ascii-font-family:Calibri;\r\nmso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:"Times New Roman";\r\nmso-fareast-theme-font:minor-fareast;\r\nmso-hansi-font-family:Calibri;\r\nmso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:"Times New Roman";\r\nmso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span style="font-size: 11pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">ACCU has been continuously offering platform for learning to Asian credit unions. In the last 19 years since 1990, the Asian Credit Union Forum has served as venue for credit union leaders and professionals to discuss issues and solutions common to Asian credit unions. The Asian credit unions have become more valuable as it now culminates with a recommendation and declaration that has been incorporated in ACCU and national federation&rsquo;s plan. Credit union leaders, professionals and development partners are welcome to attend the forum.</span></p>', 'up comming', 'Thailand', '');
