INSERT INTO `member_type_description` VALUES (1, 'Regular Members', 'The membership is open to national federation of credit unions/cooperatives/savings and credit cooperatives representing at least 20,000 individual members or 2% of the country''s population. The membership is minimum of US$ 2,000 and maximum US$ 5,000 per year computed based on the aggregated movement''s assets.');
INSERT INTO `member_type_description` VALUES (2, 'Associate Members', 'The membership is open to national organization or credit union league or federation which is not yet qualified to become a regular member. Annular due is US$ 1,500');
INSERT INTO `member_type_description` VALUES (3, 'Affiliate Member', 'The membership is open to organizations from both local and abroad promoting and supporting credit union development. The annual dues is US$ 1,000.');
INSERT INTO `member_type_description` VALUES (4, 'Supporter Members', 'Open to any primary credit union willing to participate for international development. The membership would allow accelerated access to information, networking, cooperation among cooperatives and experience sharing at international level. The annual dues is US$ 500.');
INSERT INTO `news` VALUES (1, 'ASIAN CREDIT UNION FORUM 2009', '2008-09-25', 1, '<p>Dear Credit Union Friends, <br />\r\nPlease join us for the 2008 Asian Credit Union Forum, hosted by The Cooperative Credit Union League of Bangladesh Ltd. We are very excited to welcome you in Bangladesh, a lush land with a rich history and passionate people. <br />\r\nThis annual event brings together leading credit union experts and participants from a broad range of fields, to give a fresh look at growth strategies enabling credit unions to present better choices, better organizations and better society to members and their families. <br />\r\nThe slate of renowned speakers provides you with: <br />\r\n&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<li>A fresh perspective on global socioeconomic trends for you to appreciate the need for credit unions to grow in number and quality</li>\r\n<li>A contemporary framework to guide your growth plans for 2009 and beyond</li>\r\n<li>A well-developed line-up of marketers and expertise whose unique strategies can potentially add innovation and vitality to credit union financial services <br />\r\nIn this forum, ACCU&#65533;s proposition to credit union leaders across Asia is to place credit unions&#65533; steady growth as movement&#65533;s goal in the next decade. With the topics outlined, the forum will certainly let you realize the undeserved market we need to enter on as a source of credit union growth. <br />\r\nFinding our &#65533;blue ocean&#65533; or new market space is something that we in Asian credit unions require to become skillful.\r\n<div align="center"><font size="+3"><a href="http://www.aaccu.coop/documents/accuf2008.pdf">Download Brochure</a></font></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Dhaka Sheraton Hotel BANGLADESH - Bangladesh', '');
INSERT INTO `news` VALUES (5, 'Planning Session for the Newly Elected Board of NEFSCUN ', '0000-00-00', 1, '<div align="justify">ACCU assisted the newly elected Board of Directors of NEFSCUN in reviewing the achievements of Nepal Savings and Credit Cooperative (SACCOS) Movement on February 5 to 6. The Board recognized the need for SACCOS to build its capacity to achieve growth in membership and capital. The Board realized the vital task of the federation in building the competence of SACCOS through the services it provides. The two-day workshop identified management tools (policies/procedures) the federation has to adopt for effective and efficient operation. The workshop also defined the Strategic Plan that addresses various issues on membership and services to SACCOS.</div>', '', '');
INSERT INTO `news` VALUES (6, 'Sustainable Development through Savings and Credit Cooperatives Stressed at Sub-Regional Workshop ', '0000-00-00', 1, '<p>USC-Nepal continues to demonstrate its commitment to promote savings and credit cooperatives (SACCOS) as sustainable approach to poverty alleviation. The annual South Asia Sub-Regional Workshop was held on February 6-8 in Dhulikel, Nepal with the technical assistance of ACCU. International and local NGOs attending the conference realized the role of credit unions in helping members build their wealth making it possible for them to get out of poverty. Remarkably, attendees appreciated the credit union purpose of guiding members achieve financial independence.</p>', '', '');
INSERT INTO `news` VALUES (7, 'Project Monitoring in Nepal and Bangladesh', '0000-00-00', 1, '<p>ACCU carried out review meeting on ACCESS and CUMI implementation in Nepal and Bangladesh on February 8-12 and February 24-25 respectively. Seven partner credit unions in Nepal have registered and paid technical fee for ACCESS accreditation. The meeting in Nepal emphasized the need for NEFSCUN to provide timely assistance to SACCOS to achieve ACCESS brand at reasonable period. Meanwhile, CCULB will also ensure services are provided to two credit unions enrolled in ACCESS Branding. ACCU works with CCULB and NEFSCUN to keep the CUMI evolving and adopted in credit unions to increase outreach of the &lsquo;have less&rsquo; segment of the market</p>', '', '');
INSERT INTO `news` VALUES (9, 'Credit Union Promotion in Lao PDR ', '0000-00-00', 1, '<p>ACCU CEO and representative from Agriterra met SNV Lao and Bank of Lao PDR (BOL) on February 16-19 in Vientiane. The meeting with SNV Lao discussed the implementation strategies and logistical arrangements for the credit union promotion project currently in process of approval with Agriterra. ACCU also met BOL representatives as it considers the importance of the bank&rsquo;s involvement in the project. On February 19-20, ACCU CEO discussed with the Governor of Luang Prabang the plan of credit union promotion in the province. With the support of Agriterra, ACCU is currently implementing a project in Luang Prabang in partnership with the provincial government. Meanwhile, another project will be opened for the southern part of Laos aimed at organizing credit unions and a 2nd tier organization.</p>', '', '');
INSERT INTO `news` VALUES (10, 'Orientation of the Newly Elected Board of CCULB ', '0000-00-00', 1, '<p>ACCU provided an input to the CCULB Board orientation held on February 23 in Dhaka. Becoming aware on the issues confronting credit unions has made Directors in the best position to identify the strategic direction of CCULB. Building teamwork, Board and management effective working relationships, and board functions are some of the important topics discussed by ACCU to the board of CCULB.</p>', '', '');
INSERT INTO `news` VALUES (11, '2nd CULT Exposure Program', '0000-00-00', 1, '<div align="justify">Eight countries (Indonesia, Korea, Malaysia, Mongolia, Nepal, Philippines, Sri Lanka and Thailand) are represented at the 2nd CULT Exposure on Credit Unions Development through Business Development Center held on February 21-27 in Bangkok, Thailand. Twenty-six participants enjoyed the renowned Thai hospitality while learning the operation of BDC in supporting the sustainability of members engaged in small businesses. ACCU was happy to impart the concept of BDC as providing capital for enterprises; education and developing habit of thrift would not guarantee members&rsquo; sustainability. Equally important is the provision of support through BDCs to help members engage in demand driven and high quality products/service, and connect them to the market.</div>', '', '');
INSERT INTO `news` VALUES (12, 'Sustainability, Efficiency and Professionalism Emphasized in WCCS Strategic Plan', '0000-00-00', 1, '<p>ACCU assisted the Workers&rsquo; Cooperative Credit Society (WCCS) in preparing its three-year Strategic Plan. The Chairman, Mr. Lahmana and Manager-Account/Finance Mr. M. Annamalai came to Bangkok on January 5-6 for consultation. The plan emphasized on the long-term sustainability, efficiency, and professionalism of WCCS. The Board of Directors of WCCS has approved the Strategic Plan. ACCU also facilitated the pre-planning workshop of the Board and consultation with its field volunteers last October 2007.</p>', '', '');
INSERT INTO `news` VALUES (13, 'Building the Capacity of Partner SEDOC ', '0000-00-00', 1, '<p>ACCU team provided technical assistance to SEDOC on January 13-17. The mission evaluated the financial management system, training capabilities, and installed accounting software for SEDOC. ACCU considers the reliability of partner&rsquo;s financial information as pre-requisite to sustainability and efficient management operations. ACCU works with SEDOC to transform its promoted Self-Help Groups to Community Based Financial Institutions (CBFIs). Agriterra, Netherlands supports this initiative.</p>', '', '');
