INSERT INTO `publication_catagary` VALUES (1, 'Annual Reports ', 'Our annual report is a document presented to ACCU members, partners and public to provide information of achievements as against our plan. The report contains the President report, CEO’s report, Scorecard based on our Road Map, Governance, Membership, Financial Highlights, and Credit Union Development Outlook. Other information deemed relevant to stakeholders are also included such as short term project carried out by the Asian credit union movement. The December 26, 2004 Tsunami Rehabilitation project for credit unions is an example. ', 'annual_reports_copy1.jpg', 'Y', '2008-10-07', '2008-10-07');
INSERT INTO `publication_catagary` VALUES (2, 'Technical Reports', 'ACCU is very pleased to share our technical reports such as technical studies, case studies, comprehensive independent evaluation, proceedings of workshops and conferences, recommendations to the Asian Credit Union Forum, compilation of conference/workshop presentations, and management literature. It is our commitment to provide wide range of knowledge to our members to help them professionalize the operation of credit unions in Asia.', 'technical_reports_copy1.jpg', 'Y', '2008-10-07', '2008-10-07');
INSERT INTO `publication_catagary` VALUES (3, 'ACCU News', 'ACCU News is our quarterly means of communicating to our members, partners and credit unions. The 12-page newsletter provides highlights of events ACCU carried out at the regional and in-country level. It also provides news of member organizations in Asia, worldwide credit union news and future educational opportunities available for Asian credit unions. The news is issued (hard and soft copy) in January, April, July, and October.', 'news.jpg', 'Y', '2008-10-07', '2008-10-07');
INSERT INTO `publication_catagary` VALUES (4, 'Management Report', 'The Monthly Management Report provides highlights of ACCU activities for the month. The Management sees to it that the report is presented to the Board, Delegates, CEOs of member organizations and development partners by the 10th of each month. ', 'managment_reports.jpg', 'Y', '2008-10-07', '2008-10-07');
